// src/components/Navbar/Navbar.js
import React, { useState, useRef, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {

  async function handleLogout() {
    try {
      await logout();
      setShowProfile(false);
    } catch (err) {
      console.error("Logout failed:", err);
    }
  }

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          MyPet üêæ
        </Link>

        <div className="menu-icon">
          <span className="menu-bar"></span>
          <span className="menu-bar"></span>
          <span className="menu-bar"></span>
        </div>

        <ul className="nav-menu">
          <li className="nav-item">
            <Link to="/" className="nav-links">
              Home
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/register-pet" className="nav-links">
              Register Pet
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/my-pets" className="nav-links">
              My Pets
            </Link>
          </li>
          <li className="nav-item">
            <Link to="/generate-qr" className="nav-links">
              Generate QR
            </Link>
          </li>

          {!currentUser && (
            <>
              {/* Login link removed as requested */}
              <li className="nav-item">
                <Link to="/signup" className="nav-links">
                  Sign Up
                </Link>
              </li>
            </>
          )}

          {currentUser && (
            <li
              className="nav-item"
              ref={profileRef}
              style={{ position: "relative" }}
            >
              <button
                onClick={() => setShowProfile((prev) => !prev)}
                className="profile-button"
                aria-label="User Profile"
              >
                {getInitials()}
              </button>

              {showProfile && (
  <div
    className="profile-dropdown"
    style={{
      position: "absolute",
      top: "60px",
      right: 0,
      backgroundColor: "#ffffff",
      color: "#333",
      padding: "1rem 1.2rem",
      borderRadius: "12px",
      boxShadow: "0 8px 20px rgba(0, 0, 0, 0.15)",
      minWidth: "250px",
      zIndex: 100,
      textAlign: "left",
      lineHeight: "1.6",
      fontSize: "0.95rem",
    }}
  >
    <div
      style={{
        borderBottom: "1px solid #ddd",
        paddingBottom: "0.75rem",
        marginBottom: "0.75rem",
      }}
    >
      <h4 style={{ margin: 0, fontSize: "1.1rem", color: "#4b9cd3" }}>
        Profile Info
      </h4>
    </div>
    <div style={{ marginBottom: "0.6rem" }}>
      <strong>Name:</strong> {currentUser.displayName || "N/A"}
    </div>
    <div style={{ marginBottom: "0.6rem" }}>
      <strong>Phone:</strong> {currentUser.phone || "N/A"}
    </div>
    <div style={{ marginBottom: "1rem" }}>
      <strong>Email:</strong> {currentUser.email}
    </div>
    <button
      onClick={handleLogout}
      style={{
        backgroundColor: "#e53935",
        border: "none",
        color: "white",
        padding: "0.6rem 1rem",
        cursor: "pointer",
        borderRadius: "6px",
        fontWeight: "bold",
        width: "100%",
        transition: "background-color 0.3s ease",
      }}
      onMouseEnter={(e) => (e.target.style.backgroundColor = "#c62828")}
      onMouseLeave={(e) => (e.target.style.backgroundColor = "#e53935")}
    >
      Logout
    </button>
  </div>
)}

            </li>
          )}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
